import React, {Component} from 'react';
import {Col, Form} from 'react-bootstrap'

class SubScriptionControl extends Component {
    constructor(props) {
        super(props);
        this.state = {};

    }


    render() {


        return (
            <div>
                <div>
                    <h2>Subscription Control</h2>
                </div>

                <Form>


                    <Form.Row>
                        <Form.Group>
                            <Form.Check
                                custom
                                type={'checkbox'}
                                label={`Subscribed`}
                                id={'subscription'}
                            />
                        </Form.Group>
                    </Form.Row>

                    <Form.Row>
                        <Form.Group>
                            <Form.Check
                                custom
                                type={'checkbox'}
                                label={`Social Media`}
                                id={'socialMedia'}
                            />
                        </Form.Group>
                    </Form.Row>
                    <Form.Row>
                        <Form.Group>
                            <Form.Check
                                custom
                                id={'video'}
                                type={'checkbox'}
                                label={`Video`}
                            />
                        </Form.Group>
                    </Form.Row>
                    <Form.Row>
                        <Form.Group>
                            <Form.Check
                                custom
                                id={'360'}
                                type={'checkbox'}
                                label={`Custom 360`}
                            />
                        </Form.Group>
                    </Form.Row>

                </Form>


            </div>
        )
    }


}

export default SubScriptionControl;
